CREATE PROC products
AS
BEGIN
	-- Variable declaration
	DECLARE @start_time DATETIME,
		@end_time DATETIME,
		@source_row_count INT,
		@target_row_count INT,
		@error_message VARCHAR(MAX),
		@ProductID VARCHAR(10),
		@unit_sold DECIMAL(5),
		@Product VARCHAR(30),
		@Total_UnitCost DECIMAL(8,2),
		@Total_UnitPrice DECIMAL(8,2),
		@city VARCHAR(30),
		@maxPurchase DECIMAL(8,2),
		@profit_percentage INT,
		@loss_percentage INT

END;
